import React from "react";

const Tree = (props) => {
  const txDivs = [];

  props.tree.forEach((tx) => {
    txDivs.push(<div>{tx}</div>);
  });

  return (
    <div>
      <div>
        {props.tree.map((tx, i) => (
          <div id={i}>{tx}</div>
        ))}
      </div>
    </div>
  );
};

export default Tree;
